import React from 'react';
import './Extsignin.css';


import Signin from '../signpage/Signin';
import Navbar from '../navbar/Navbar';
import Footer from '../footer/Footer';






function Extsignin() {



    return (
        
        <div>

            <Navbar />
            <Signin />
            <Footer />

            
        </div>
    )
}

export default Extsignin
